pragma solidity ^0.5.16;

contract Wahl {

    struct Waehler {
        bool hatAbgestimmt; 
        bool istBerechtigt; 
        uint256 kandidatenIndex;
    }
    struct Kandidat {
        uint256 id;
        string name;
        uint256 stimmen; // Anzahl der erhaltenen Stimmen
    }

    mapping (uint256 => Waehler) public waehler;
    Kandidat[] public kandidaten;

    address public veranstalter;
    uint256 public startZeit;
    uint256 public endZeit;
    uint public value;

    event Abstimmung(uint256 indexed matrikelnummer, uint256 indexed kandidatenIndex);
    event KandidatErstellt(uint256 indexed id, string name);

    modifier nurVeranstalter() {
        require(msg.sender == veranstalter, "Nur der Veranstalter darf diese Aktion ausfuehren.");
        _;
    }

    constructor(address _veranstalter, uint _startZeit, uint _endZeit, uint _value) public {
        veranstalter = _veranstalter;
        startZeit = _startZeit;
        endZeit = _endZeit;
        value = _value;
        }

    function pruefeTeilnahmeberechtigung(uint256 _matrikelnummer) public view returns (bool) {
        return waehler[_matrikelnummer].istBerechtigt;
    }

      function stimmeAb(uint256 _matrikelnummer, uint256 _kandidatenIndex) public {
        require(block.timestamp >= startZeit && block.timestamp <= endZeit, "Die Wahl ist nicht geöffnet.");
        require(waehler[_matrikelnummer].istBerechtigt, "Der Wähler ist nicht zur Teilnahme berechtigt.");
        require(!waehler[_matrikelnummer].hatAbgestimmt, "Der Wähler hat bereits abgestimmt.");
        require(_matrikelnummer > 0, "Ungültige Matrikelnummer.");
        require(_kandidatenIndex < kandidaten.length, "Ungültiger Kandidatenindex.");

        waehler[_matrikelnummer].hatAbgestimmt = true;
        waehler[_matrikelnummer].kandidatenIndex = _kandidatenIndex;
        kandidaten[_kandidatenIndex].stimmen++;

        emit Abstimmung(_matrikelnummer, _kandidatenIndex);
    }

    function stimmenAuszaehlen() public view nurVeranstalter returns (uint256[] memory) {
    require(block.timestamp > endZeit, "Die Wahl ist noch nicht beendet.");

    uint256[] memory ergebnisse = new uint256[](kandidaten.length);

    for (uint256 i = 0; i < kandidaten.length; i++) {
        ergebnisse[i] = kandidaten[i].stimmen;
    }

    return ergebnisse;
}


    function berechtigeWaehlerListe(uint256[] memory _matrikelnummern) public nurVeranstalter {
        for (uint256 i = 0; i < _matrikelnummern.length; i++) {
            waehler[_matrikelnummern[i]].istBerechtigt = true;
        }
    }

    function erstelleKandidat(string memory _name) public nurVeranstalter {
        uint256 kandidatId = kandidaten.length;
        Kandidat memory neuerKandidat = Kandidat(kandidatId, _name, 0);
        kandidaten.push(neuerKandidat);

        emit KandidatErstellt(kandidatId, _name);
    }
}
